                <img className="conatct--img"src={props.img} alt=""/>
                <h1> { props.name}</h1>
            </div>
         <div className="infos--group">
         <FaEnvelope size={15} style={{ color: 'black', marginRight: '10px' }} />
           <p>{ props.phone}</p>  
         </div>   
        </div>

    )
}
